package com.example.weather.repository;import lombok.Getter;import lombok.Setter;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "sys")@Getter@Setterpublic class SysEntity extends BaseEntity {    @Column(name = "sys_ref_Id")    public void setRefId(Long refId) {        super.setRefId(refId);    }    @Column    private int type;    @Column (name = "sys_response_id")    private int sysResponseId;    @Column    private String country;    @Column    private int sunrise;    @Column    private int sunset;}